 pragma solidity ^0.4.24;

 contract Mailbox {

     // struct Request {
     //     bytes32 sender;
     //     bytes32 feed;
     // }

     // Request[] requests;

     // namehash => swarmhash (pending)
     mapping(bytes32 => bytes32) internal requests;
     mapping(bytes32 => bytes32) internal connections;
     bytes32[] public requestSenders;
     bytes32[] public connectionsArray;

     address internal owner;

     modifier only_owner() {
         require(owner == msg.sender);
         _;
     }

     /**
      * Constructor.
      */
     constructor() public {
         owner = msg.sender;
     }

     function newRequest(bytes32 sender, bytes32 feed) public returns (bool) {
         require(requests[sender] == 0x0);
         requests[sender] = feed;
         requestSenders.push(sender);
         return true;
     }

     function getRequests() view public returns (bytes32[]) {
         return requestSenders;
     }

     // function getRequest(bytes32 sender) only_owner public view returns (bytes32) {
     //     return requests[sender];
     // }

     function getRequest(bytes32 sender) public view returns (bytes32) {
         return requests[sender];
     }

     function removeRequest(bytes32 sender) only_owner public returns (bool) {
         requests[sender] = 0x0;
         // not deleting array entry
         return true;
     }

     function addConnection(bytes32 sender, bytes32 feed) only_owner public returns (bool) {
         // if a connection exists, feed is only updated
         if (connections[sender] == 0x0) connectionsArray.push(sender);
         connections[sender] = feed;
         return true;
     }

     function removeConnection(bytes32 sender) only_owner public returns (bool) {
         connections[sender] = 0x0;
         // we need to also delete array entry
         return true;
     }

     function getConnections() public view returns (bytes32[]) {
         return connectionsArray;
     }

     function getConnection(bytes32 sender) public view returns (bytes32) {
         return connections[sender];
     }

 }
